/* eslint-disable react-hooks/exhaustive-deps */

// import modules
import React, { Component } from 'react';
import {
  Route,
  BrowserRouter as Router,
  Routes,
  Link
} from "react-router-dom";

// import css
import './css/App.css';
import './css/SearchBar.css';
import './css/Spotify.css';

// import components
import Login from "./components/Login";
import SearchBar from "./components/SearchBar";
import TopPlaylists from './components/TopPlaylists';
import HomePage from './components/HomePage'; // Assuming you have a HomePage component

class App extends Component {
  render() {
    // return html page
    return (
      <Router>
        <div className="App">
          <ul className="AppHeader">
            <li><Link to="/">HomePage</Link></li>
            <li><Link to="/login">Login</Link></li>
            <li><Link to="/search">SearchBar</Link></li>
            <li><Link to="/top_playlists">TopPlaylists</Link></li>
          </ul>
          <Routes>
            <Route path='/' element={<HomePage />} />
            <Route path='/login' element={<Login />} />
            <Route path="/search" element={<SearchBar />} />
            <Route path="/top_playlists" element={<TopPlaylists />} />
          </Routes>
          <footer>
            <p>&copy; 2023 Book-Inspired Playlist Generator</p>
          </footer>
        </div>
      </Router>
    );
  }
}

export default App;
